#!/usr/bin/python3
#Setting up my stuff.
import sys
import os
import getopt
def clear():
    os.system('cls' if os.name == 'nt' else 'clear')

#Exception.
try:
    opts, args = getopt.getopt(sys.argv[1:], "i:h")
except getopt.GetoptError as err:
    print ("For usage help, please use: python3 duckie -h")
    sys.exit()

#Duckie.
imgData = b''

#Main code.
inputfile = ''
for opt, arg in opts:
    if opt == "-i":
        inputfile = arg
        
        if inputfile.lower().endswith((".png", ".jpg", ".jpeg", ".bmp", ".gif", ".tiff", ".exif")):
            with open(inputfile, "wb") as fh:
                fh.write(imgData.decode('base64'))
                print ("Enjoy your duck!")
        else:
            print ("Sorry, that is not a supported file.")
    elif opt == "-h":
        print ("Duckie will replace any photo with a photo of a duck!")
        print ("Usage: python duckie.py /path/to/image.file")
sys.exit()